import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  padding: 25px;
`;

const Headline = styled.p`
  font-size: 24px;
  font-weight: bold;
  font-family: Helvetica Neue, Arial, sans-serif;
  line-height: 1;
  margin: 0;
`;

const SectionsCompleted = styled.p`
  font-size: 12px;
  font-weight: bold;
  font-family: Helvetica Neue, Arial, sans-serif;
  color: rgb(1, 121, 213);
  line-height: 1;
`;

const Subheadline = styled.p`
  font-size: 16px;
  font-family: Helvetica Neue, Arial, sans-serif;
  line-height: 1;
`;

export default function Card() {
  return (
    <Container>
      <Headline>What is Diabetes</Headline>
      <SectionsCompleted>0/5 LESSONS COMPLETED</SectionsCompleted>
      <Subheadline>
        In this section you will learn the diabetes mellitus (DM) basics,
        regarding what diabetes is and how it is diagnosed.
      </Subheadline>
      <hr />
    </Container>
  );
}
